import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import './navcomponent.css'

const Navcomponent = () => {
  return (
    <Navbar>
    <Container>
      <Navbar.Brand href="#home" className="text-white">SALES APP</Navbar.Brand>
      <Nav className="me-auto">
        <Nav.Link href="#home" className="text-white">ADD SALES</Nav.Link>
        <Nav.Link href="#features" className="text-white">TOP SALES</Nav.Link>
        <Nav.Link href="#pricing" className="text-white">TODAYS TOTAL REVENUE</Nav.Link>
        <Nav.Link href="#pricing" className="text-white">LOGIN</Nav.Link>
        <Nav.Link href="#pricing" className="text-white">REGISTER</Nav.Link>
        <Nav.Link href="#pricing" className="text-white">LOGOUT</Nav.Link>
      </Nav>
    </Container>
  </Navbar>
  )
}

export default Navcomponent
